import pdfFile from '../myresume.pdf'

const Nav = (props) => {

    const showPage = (num) => {
        props.setPage(num)
        console.log(num);
      }

  return (
    <div className='navigation'>
        <div className='nav-buttons'>
            <button className='home-button navB' onClick={() => showPage(0)}>Home</button>
            <button className='about-button navB' onClick={() => showPage(1)}>About</button>
            <button className='skills-button navB btn' onClick={() => showPage(2)}>Skills</button>
            <a  className='btn' href={pdfFile} target='blank'>Download Resume</a>
        </div>
    </div> 
  )
}

export default Nav
